const todosData = [
    {
        id: 1,
        text: "Wake Up",
        completed: true
    },
    {
        id: 2,
        text: "Eat some",
        completed: false
    },
    {
        id: 3,
        text: "Go to work",
        completed: false
    },
    {
        id: 4,
        text: "Go home",
        completed: false
    },
    {
        id: 5,
        text: "Go to sleep",
        completed: false
    }
]

export default todosData
